import React from 'react';
import AppHeader from './app-header/'
import ToDoList from './todo-list/'
import SearchPanel from './search-panel/'
import ItemStatusFilter from './item-status-filter/'
import './app.css';
const App = () => {
    const todoData = [{ //сдесь мы создаем данные, которые будут
        // использоваться в качестве props, смотри ToDoList
        label: 'Kiss Mila',
        important: true,
        id: 1
    },
    {
        label: 'Make awesome App',
        important: true,
        id: 2
    },
    {
        label: 'Drink coffee',
        important: false,
        id: 3

    }
    ]
    //const isLogged = true;
    //const loginBox = <span> Login please </span>;
    //const welcomeBox = <span> Welcome Back</span>
    // {isLogged ? welcomeBox :loginBox} должно быть в return

    return (<div className='todo-app'>

        <AppHeader todo={1} done={3} />
        <div className='top-panel d-flex'>
            <SearchPanel />
            <ItemStatusFilter />
        </div>
        <ToDoList todos={todoData} />
    </div>)// сдесь мы указываем источник для свойства todos
}; //elements

//const el = React.createElement('h1', null, 'Hello World!!!') JS-syntax, after Babel
export default App;
